# Количество различных подстрок в строке
# Дана строка s длины n. Требуется посчитать количество её различных подстрок.
# Будем решать эту задачу итеративно. А именно, научимся, зная текущее количество различных подстрок,
# пересчитывать это количество при добавлении в конец одного символа.
# Итак, пусть k — текущее количество различных подстрок строки s, и мы добавляем в конец символ c. Очевидно,
# в результате могли появиться некоторые новые подстроки, оканчивавшиеся на этом новом символе c (а именно,
# все подстроки, оканчивающиеся на этом символе, но не встречавшиеся раньше).
# Возьмём строку t = s + c и инвертируем её (запишем символы в обратном порядке). Наша задача —
# посчитать, сколько у строки t таких префиксов, которые не встречаются в ней более нигде. Но если мы посчитаем
# для строки t Z-функцию и найдём её максимальное значение Zmax, то, очевидно, в строке t встречается (не в начале)
# её префикс длины Zmax, но не большей длины. Понятно, префиксы меньшей длины уже точно встречаются в ней.
# Итак, мы получили, что число новых подстрок, появляющихся при дописывании символа c, равно len - Zmax, где
# len — текущая длина строки после приписывания символа c.
# Следовательно, асимптотика решения для строки длины n составляет O(n**2).
# Стоит заметить, что совершенно аналогично можно пересчитывать за O(n) количество различных подстрок и
# при дописывании символа в начало, а также при удалении символа с конца или с начала.

import time

start_time = time.time()


def z_func(s):
    n = len(s)
    k = 0
    z = [0] * len(s)
    t = ''
    for i in range(0, n):
        t += s[i]
        rt = t[::-1]
        # r, l = 0, 0
        for j in range(1, len(rt)):
            # if j <= r:
            #     z[j] = min(r - j + 1, z[j - l])
            while j + z[j] < len(rt) and rt[z[j]] == rt[j + z[j]]:
                z[j] += 1
            # if j + z[j] - 1 > r:
            #     l = j
            #     r = j + z[j] - 1
        k += len(rt) - max(z)
    print(k)


z_func('')
print("time elapsed: {:.2f}s".format(time.time() - start_time))
